jQuery(document).ready(function($) {
	$("a.overlay").click(function(e) {
		e.preventDefault();
	  	var url=$(this).attr('href');
	  	$("body").addClass("noscroll");
	  
		$("#overlay").velocity("fadeIn", {duration: 300});
		$("#main-info").velocity("fadeIn", {duration: 1000});
	  	$("#overlay").load( url+" #main-info",function(){
	  		$("#overlay, .close").click(function(e){
				if (e.target.id === "main-info" || e.target.id === "overlay" || $(e.target).hasClass("top") || this===e.target){
					e.preventDefault();
			    	$("#overlay").velocity("fadeOut", {duration: 300});
				  	$("body").removeClass("noscroll");
				  	$("#overlay").html("");
			    }
			});
	  	});
	});

});

